func (c *current) onSeq1(v any) (any, error) {

	vals, ok := toAnySlice(v)
	if !ok {
		return nil, nil
	} else {
		left, _ := vals[0].(node)
		right, _ := vals[1].(node)

		left.setNext(right)

		return left, nil
	}
}

