func (c *current) onCondition1(e any) (any, error) {

	elems, isGroup := toAnySlice(e)

	if !isGroup {
		return e, nil
	}

	isNegated := elems[0] != nil
	cond, _ := elems[1].(condition)

	if isNegated {
		return negatedCondition{toNegate: cond}, nil
	}

	return cond, nil

}

